let categories = getCategories(data)

let unique = categories.filter(onlyUnique)

let list = initList(unique)

fillList(data, list)

let listAverage = computeAverage(list, unique)

createFile(listAverage, unique)

function createFile (listAverage, unique) {
  var logger = fs.createWriteStream('data/final-log-' + nonce() + '.dat')
  for (let i = 0; i < unique.length; i++) {
    logger.write(i + '\t' + listAverage[unique[i]] + '\t' + unique[i] + '\n')
  }
  logger.end()
}

function computeAverage (list, categories) {
  let newList = list

  for (let i = 0; i < categories.length; i++) {
    newList[categories[i]] = ss.mean(newList[categories[i]])
  }

  return newList
}

function fillList (data, list) {
  for (let i = 0; i < data.length; i++) {
    let currCategory = data[i].transactionData.gasPrice
    let currValue = data[i].transactionData.minedTimestamp - data[i].date // timestamp
    list[currCategory].push(currValue)
  }
}

function initList (unique) {
  let list = []

  for (let i = 0; i < unique.length; i++) {
    list[unique[i]] = []
  }
  return list
}

function getCategories (data) {
  let categories = []
  for (let i = 0; i < data.length; i++) {
    let cat = data[i].transactionData.gasPrice
    categories.push(cat)
  }
  return categories
}

function onlyUnique (value, index, self) {
  return self.indexOf(value) === index
}
